import React,{useState, useEffect} from "react";
import { Card, Col, Row } from "antd";
import { EditOutlined, DeleteOutlined } from "@ant-design/icons";
import { connect } from "react-redux";
import apiRequest from "../../apiRequest";
const CardView = (props) => {
  console.log('tripDatas,',props.tripDatas);
  return (
    <div className="site-card-wrapper">
      <Row gutter={16}>
        <Col span={8}>
          <Card
            title="Card title"
            bordered={true}
            actions={[
              <EditOutlined key="edit" />,
              <DeleteOutlined key="delete" />
            ]}
          >
            <div className="trip-date">
              <b className="mr10">Date:</b>2020-03-13
            </div>
            <div className="trip-duration">
              <b className="mr10">Duration:</b>23
            </div>
            <div className="trip-commnet">
              <b className="mr10">Comments:</b>portals Future-proofed Baby
            </div>
          </Card>
        </Col>
      </Row>
    </div>
  );
};

const mapStateToProps = state => {
  return {
    urls: state.url,
    tripDatas: state.allTripDatas
  };
};
const mapDispacthToProps = dispatch => {
  return {
    updateTripData: values => {
      dispatch({ type: "TRIPDATA", value: values });
    },
  };
};
export default connect(
  mapStateToProps,
  mapDispacthToProps
)(CardView);
